// src/App.tsx

import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import HomePage from './HomePage';

const App: React.FC = () => {
  return (
    <Router>
        <Route path="/" Component={HomePage} />
    </Router>
  );
};

export default App;
